import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
    return (
        <div>
            <NavLink to="/" exact>Home</NavLink>
            <NavLink to="/about" exact>About</NavLink>
            <NavLink
                to="/login"
                exact
                style={linkStyles}
                activeStyle={{
                    background: "darkblue",
                }}
            >
                Login
            </NavLink>
            <NavLink
                to="/contacts"
                exact
                style={linkStyles}
                activeStyle={{
                    background: "darkblue",
                }}
            >
                Contacts
            </NavLink>
            <NavLink
                to="/mycard"
                exact
                style={linkStyles}
                activeStyle={{
                    background: "darkblue",
                }}
            >
                My Information
            </NavLink>
        </div>
    );
}

export default NavBar;
